script: |
  super -f text -I q10555.spq | sort > q10555.out

inputs:
  - name: q10555.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + 68 + + col2 NOT IN ( ( + 72 ) + 92 * 83, col1, 12 * + col0 * - 13 + + col2 );
  - name: tab1

outputs:
  - name: q10555.out
    data: |
      51	14	96
      85	5	59
      91	47	68
